import { React, useState, useEffect } from 'react';
import Menu from "../../components/menu/menu"
import Footer from "../../components/footer/footer"
import "./estoque.css"

import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';


const useStyles = makeStyles((theme) => ({
    formControl: {
        margin: theme.spacing(1),
        minWidth: 250,
        minHeight: 25
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
        minHeight: 25
    },
    root: {
        '& .MuiTextField-root': {
            margin: theme.spacing(1),
            width: '25ch',
        },
    },
}));

export default function Estoque(props) {
    const classes = useStyles();

    return (
        <>
            <Menu />

            <menu className="menu-left">
                <div className="menu-left-div">
                    <FormControl variant="outlined" className={classes.formControl}>
                        <InputLabel htmlFor="outlined-age-native-simple">Blindado</InputLabel>
                        <Select
                            native
                            value={""}
                            onChange={""}
                            label="Blindado"
                        >

                            <option value={10}>SIM</option>
                            <option value={20}>NÃO</option>
                        </Select>
                    </FormControl>
                    <FormControl variant="outlined" className={classes.formControl}>
                        <InputLabel htmlFor="outlined-age-native-simple">Marca</InputLabel>
                        <Select
                            native
                            value={""}
                            onChange={""}
                            label="Blindado"
                        >
                            <option aria-label="Todos" value="" />
                            <option value={10}>SIM</option>
                            <option value={20}>NÃO</option>
                        </Select>
                    </FormControl>
                    <FormControl variant="outlined" className={classes.formControl}>
                        <InputLabel htmlFor="outlined-age-native-simple">Preço</InputLabel>
                        <Select
                            native
                            value={"SIM"}
                            onChange={""}
                            label="Blindado"
                        >
                            {/* <option aria-label="None" value="siM" /> */}
                            <option value={10}>SIM</option>
                            <option value={20}>NÃO</option>
                        </Select>
                    </FormControl>
                    <FormControl variant="outlined" className={classes.formControl}>
                        <InputLabel htmlFor="outlined-age-native-simple">Blindado</InputLabel>
                        <Select
                            native
                            value={""}
                            onChange={""}
                            label="Blindado"
                        >
                            <option aria-label="None" value="" />
                            <option value={10}>SIM</option>
                            <option value={20}>NÃO</option>
                        </Select>
                    </FormControl>
                    <FormControl variant="outlined" className={classes.formControl}>
                        <InputLabel htmlFor="outlined-age-native-simple">Ano</InputLabel>
                        <Select
                            native
                            value={""}
                            onChange={""}
                            label="Blindado"
                        >
                            <option aria-label="None" value="" />
                            <option value={10}>Fazer MAP</option>

                        </Select>
                    </FormControl>
                    <FormControl variant="outlined" className={classes.formControl}>
                        <InputLabel htmlFor="outlined-age-native-simple">Câmbio</InputLabel>
                        <Select
                            native
                            value={""}
                            onChange={""}
                            label="Blindado"
                        >
                            <option aria-label="None" value="" />
                            <option value={10}>MANUAL</option>
                            <option value={20}>AUTOMÁTICO</option>
                            <option value={20}>SEMIAUTOMÁTICO</option>
                            <option value={20}>AUTOMATIZADO</option>
                        </Select>
                    </FormControl>
                </div>

            </menu >
            <Footer />
        </>

    )
}
